contracts/DUUID/duuid.sol.content:
// SPDX-License-Identifier: GPL-3.0

// Version of compiler
pragma solidity >=0.7.0 <0.9.0;

import "./university.sol";

contract duuid {

    uint studentsSubscribed = 0;

    address[] public unisList;
    mapping(address => University) public universities;

    function getNextAvailableStudent_ID() public returns (uint) {
        studentsSubscribed++;
        return studentsSubscribed;
    }

    function addUni(string memory name, uint fundationYear) public {
                // Deploy a new Student contract
        University newUni = new University(name, fundationYear);
        
        // Add the newly deployed Student contract's address to the student list
        unisList.push(address(newUni));

    }
}

contracts/DUUID/university.sol.content:
// SPDX-License-Identifier: GPL-3.0

// Version of compiler
pragma solidity >=0.7.0 <0.9.0;

import "./duuid.sol";
import "./student.sol";

contract University {

    duuid public chain;

    string public UniName;
    uint public fundationYear;

    address[] public studentList;
    mapping(address => Student) public students;

    uint public studentsSubscribed = 0;


    constructor(string memory _UniName, uint _fundationYear) {
        UniName = _UniName;
        fundationYear = _fundationYear;
    }

    function addStudent(string memory name, uint enrollmentYear, string memory institutional_ID) public {
        studentsSubscribed++;
        Student newStudent = new Student(name, enrollmentYear, institutional_ID, studentsSubscribed);

        studentList.push(address(newStudent));
    }

    function concedeStudentsCredits(address studentAddress, uint credits) public {
        Student student = Student(studentAddress);
        student.addCredits(credits);
    }

    function changeStudentsCGPA(address studentAddress, uint CGPA) public {
        Student student = Student(studentAddress);
        student.updateCGPA(CGPA);
    }
}

contracts/DUUID/student.sol.content:
// SPDX-License-Identifier: GPL-3.0

// Version of compiler
pragma solidity >=0.7.0 <0.9.0;

import "./duuid.sol";

contract Student {

    string public name;
    uint public enrollmentYear;
    string public institutional_ID;
    uint public duuID_number;
    uint public CGPA = 0;
    uint public creditsEarned = 0;

    constructor(string memory _name, uint _enrollmentYear, string memory _institutional_ID, uint _duuID_number) {
        name = _name;
        enrollmentYear = _enrollmentYear;
        institutional_ID = _institutional_ID;
        duuID_number = _duuID_number;
    }

    function getStudentDetails() public view returns (string memory, string memory, uint, uint, uint) {
        return (name, institutional_ID, CGPA, duuID_number, creditsEarned);
    }

    function giveStudentChainID() public view returns (uint) {
        return giveStudentChainID();
    }

    function addCredits(uint credits) public {
        creditsEarned += credits;
    }

    function updateCGPA(uint _CGPA) public {
        CGPA = _CGPA;
    }
}

